define([
  'shared/models/BaseCollection', 'shared/models/BaseModel'
], function (BaseCollection, BaseModel) {

  var EnumValue = BaseModel.extend({
    defaults: {
      label: null,
      value: null
    }
  });

  var EnumValues = BaseCollection.extend({
    model: EnumValue
  });

  return {
    Model: EnumValue,
    Collection: EnumValues
  };
});